class NewsCategory extends React.Component {
  state = {};
  render() {
    return (
      <div>
        {this.props.newsList.articles.map((e, index) => (
          <div key={index}>
            <p className="text-justify colored">
              <strong>Date:</strong> {e.publishedAt}
            </p>
          </div>
        ))}
      </div>
    );
  }
}

export default NewsCategory;
